import React, { useEffect, useState } from "react";
import { useParams } from "react-router-dom";
import { Jumbotron, Container, Image} from "react-bootstrap";
import styles from "../CSS/Category.module.css";

import NotAccess from "./NotAccess"


export default function Account () {
  const { id } = useParams();
  const [user, setUser] = useState([]);

  var myHeaders = new Headers();
  myHeaders.append("Authorization", document.cookie.split("token=")[1]);

  var requestOptions = {
    method: 'GET',
    headers: myHeaders,
    redirect: 'follow'
  };

  useEffect( () => {
    fetch(`http://localhost:8080/users/getuser/${id}`, requestOptions)
      .then((response) => {
        return response.json()
      })
      .then((data) => {
        setUser(data || [])
      })
  }, [])

  return (
    <Jumbotron id="about" className={styles.Jumbotron} fluid>
      {document.cookie.split("token=")[1] ? 
      <Container>
        <div className={styles.card}>
          <h1 className={styles.heading}>
            <span className={styles.Us}>Account</span>
          </h1>
          <div className={styles.links}>

          </div>
        </div>
      </Container>
        : <NotAccess/> }
      <div className={styles.lineGrade} ></div>
    </Jumbotron>
  );
}
